const darkColor = "#262726"
const lightColor = "#eaeaea"
const accent = "#d0b68c";

const theme = {
    light: {
        bg: lightColor,
        elementColor: "#090303",
        color: darkColor,
    },
    dark: {
        bg: darkColor,
        elementColor: "#303130",
        color: accent,
    }
}

export default theme
